import React from "react";
import web from "../src/images/cse.jpg";
import { NavLink } from "react-router-dom";
import Top from "./Top";
import "./script.js"

const Home = () => {

return(
    <>
      <section id= "header" className="d-flex align-items-center" >
        <div className="container-fluid nav_bg" >
            <div className="row" >
                 <div className="col-10 mx-auto" >
                     <div className="row">
                     <div className="col-md-6 col-10 mb-1 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column  animated">
                         <h1> Computer Science & Engineering </h1>
                         <h2 className="my-3 text-capitalize"> We are <strong className="brand-name"> bitians </strong>
                              <span>second to none</span>
                         </h2>
                         <div className=" mt-3">
                             <NavLink to="/service" className="btn-visit"> Visit </NavLink>
                         </div>
                     </div>

                    <div className="col-lg-6 col-12 order-1 order-lg-2 header-img">
                        <img src={web} className="img-fluid" alt="home img" />
                    </div>
                    </div>
                 </div>
             </div>
       </div>
      </section>
      <Top/>

    </>
);
};
export default Home;
